import React, { Component } from 'react'


class Header extends Component
{


    render()
    {
        return(
            <>
                <nav class="navbar navbar-expand-lg">

                    <ul class="">
                        <li><Link to="/Home"> Home </Link></li>
                    </ul>

                </nav>


            </>
        )

    }
}
















export default Header;
